import React, { Component } from 'react';
import './column_block_title.css';

class Column_block_title extends Component{
    constructor(props){
        super(props);
        this.state = {
            title : this.props.title,
            id : this.props.id
        }
        this.addTitle = this.addTitle.bind(this);
    }

}
